import { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import axios from 'axios'
import CommentForm from './CommentForm'
import UpdateComment from './UpdateComment'
import Client from '../services/api'
const PostDetails = ({ user }) => {
  let { id } = useParams()

  const [showResults, setShowResults] = useState(null)

  const clicky = (e, commentId) => {
    e.preventDefault()
    if (!commentId) {
      setShowResults(null)
    } else setShowResults(commentId)
  }
  const antiClicky = (e) => {
    e.preventDefault()
    setShowResults(null)
  }

  const [postDetails, setPostDetails] = useState()

  const [isLoaded, setIsLoaded] = useState(false)

  const getPostDetails = async () => {
    const postDeets = await axios.get(`http://localhost:3001/posts/post/${id}`)
    setPostDetails(postDeets.data)
    setIsLoaded(true)
  }

  const deleteComment = async (e, commentId) => {
    e.preventDefault()
    await Client.delete(`http://localhost:3001/comment/delete/${commentId}`)
    getPostDetails()
  }
  useEffect(() => {
    getPostDetails()
  }, [])
  let userOptions
  if (user) {
    userOptions = (
      <div>
        <CommentForm
          postDetails={postDetails}
          user={user}
          getPostDetails={getPostDetails}
        />
      </div>
    )
  }
  const publicOptions = <div></div>
  if (isLoaded) {
    return (
      <div className="wholepage">
        <h1 className="detailsheader">
          {postDetails.fishType} {postDetails.fishSpecies}
        </h1>
        <div className="thepost">
          <img src={postDetails?.image} alt={'post'} className="picture"></img>
          <div className="fontbackground">
            <p>User Name: {postDetails?.owner?.userName}</p>
          </div>
          <div className="fontbackground">
            <p>fishType: {postDetails?.fishType}</p>
          </div>
          <div className="fontbackground">
            <p>fishSpecies: {postDetails?.fishSpecies}</p>
          </div>
          <div className="fontbackground">
            <p>fishSize: {postDetails?.fishSize}</p>
          </div>
          <div className="commentsedit">
            <h3 className="commentTxt">Comments</h3>
            {postDetails.comments.map((comment) => (
              <div className="usercomments">
                {comment.post.userName}: {comment.content}
                {user?.id === comment?.userId && (
                  <div>
                    <button
                      className="commentDelete-btn"
                      onClick={(e) => deleteComment(e, comment.id)}
                    >
                      Delete
                    </button>
                    <button
                      className="updateComment-btn"
                      onClick={(e) => clicky(e, comment.id)}
                    >
                      Update
                    </button>
                    <div>
                      {comment?.id === showResults && (
                        <UpdateComment
                          clicky={clicky}
                          getPostDetails={getPostDetails}
                          comment={comment}
                          antiClicky={antiClicky}
                        />
                      )}
                    </div>
                  </div>
                )}
              </div>
            ))}
            <div></div>
          </div>
          <div>{user ? userOptions : publicOptions}</div>
        </div>
      </div>
    )
  }
}
export default CarDetails
